import React from 'react';
import { CSVLink } from 'react-csv';

const DownloadButton = ({ data, filename }) => {
  const headers = [
    { label: 'ID', key: 'id' },
    { label: 'Nome', key: 'nome' },
    { label: 'Telefone 1', key: 'numeroTelefone1' },
    { label: 'Telefone 2', key: 'numeroTelefone2' },
    { label: 'Plataforma', key: 'plataforma' },
    { label: 'E-mail', key: 'email' },
    { label: 'Número de Vendas', key: 'venda.length' }, // Adapte conforme necessário
  ];

  return (
    <CSVLink data={data} headers={headers} filename={filename}>
      <button type="button">Download CSV</button>
    </CSVLink>
  );
};

export default DownloadButton;
